package practice;import java.util.Stack;public class stackToQueue {    private Stack<Integer> stackA = new Stack<>();    private Stack<Integer> stackB = new Stack<>();    /**     * 入队     * @param element     */    public void enQueue(int element) {        stackA.push(element);    }    /**     * 出队     * @return     */    public Integer deQueue() {        if (stackB.isEmpty()) {            if (stackA.isEmpty()) {                return null;            }            transfer();        }        return stackB.pop();    }    /**     * 栈A元素转移到B     */    private void transfer() {        while(!stackA.isEmpty()) {            stackB.push(stackA.pop());        }    }}